class Solution:
    def isSubsequence(self, s: str, t: str) -> bool:
        s_list = list(s)
        t_list = list(t)
        s_copy = []
        for char in s_list:
            s_copy.append(char)
        result = []
        for char in t_list:
            if char in s_copy:
                result.append(char)
                s_copy.remove(char)
        return s_list == result
